INSERT INTO "prompts" VALUES('prompt_001','code-review-assistant','Code Review Assistant','Get comprehensive code reviews with actionable feedback on best practices, performance, and security.',replace('You are an expert code reviewer. Please review the following code and provide:\n\n1. **Code Quality Assessment**: Rate the overall quality (1-10) and explain why\n2. **Best Practices**: Identify any violations of coding best practices\n3. **Performance Issues**: Point out any potential performance bottlenecks\n4. **Security Concerns**: Flag any security vulnerabilities\n5. **Suggestions**: Provide specific, actionable improvements\n\nBe constructive and educational in your feedback.\n\nCODE TO REVIEW:\n{{code}}','\n',char(10)),NULL,'coding','code-review,best-practices,security',NULL,NULL,NULL,'instruction','intermediate',NULL,NULL,0,'Ralphy Team',NULL,NULL,'CC-BY-4.0',246,128,0,45,0,0,0,0,NULL,'1.0.0','published',1,0,0,NULL,'en','2026-01-21 15:59:35',NULL,NULL);
INSERT INTO "prompts" VALUES('prompt_002','blog-post-generator','Blog Post Generator','Generate engaging blog posts with proper structure, SEO optimization, and compelling content.',replace('Write a comprehensive blog post about {{topic}}.\n\nRequirements:\n- **Title**: Create a catchy, SEO-optimized title\n- **Introduction**: Hook the reader in the first paragraph\n- **Main Content**: 3-5 sections with subheadings\n- **Examples**: Include real-world examples where applicable\n- **Conclusion**: Summarize key takeaways with a call-to-action\n\nTarget audience: {{audience}}\nTone: {{tone}}\nWord count: Approximately {{word_count}} words\n\nMake it engaging, informative, and actionable.','\n',char(10)),NULL,'writing','blog,content,seo,marketing',NULL,NULL,NULL,'instruction','beginner',NULL,NULL,0,'Ralphy Team',NULL,NULL,'CC-BY-4.0',572,324,0,156,0,0,0,0,NULL,'1.0.0','published',1,0,0,NULL,'en','2026-01-21 15:59:35',NULL,NULL);
INSERT INTO "prompts" VALUES('prompt_003','data-analysis-prompt','Data Analysis Framework','Structured approach to analyzing datasets and extracting meaningful insights.',replace('Analyze the following data and provide insights:\n\nDATA:\n{{data}}\n\nPlease provide:\n1. **Summary Statistics**: Key metrics and distributions\n2. **Patterns & Trends**: Notable patterns in the data\n3. **Anomalies**: Any outliers or unusual observations\n4. **Correlations**: Relationships between variables\n5. **Recommendations**: Actionable next steps based on findings\n\nPresent findings in a clear, structured format with visualizations described where helpful.','\n',char(10)),NULL,'analysis','data,statistics,insights',NULL,NULL,NULL,'instruction','advanced',NULL,NULL,0,'Ralphy Team',NULL,NULL,'CC-BY-4.0',189,76,0,34,0,0,0,0,NULL,'1.0.0','published',0,0,0,NULL,'en','2026-01-21 15:59:35',NULL,NULL);
INSERT INTO "prompts" VALUES('prompt_004','email-writer','Professional Email Writer','Craft professional emails for various business scenarios with appropriate tone and structure.',replace('Write a professional email with the following details:\n\n**Purpose**: {{purpose}}\n**Recipient**: {{recipient}}\n**Key Points to Cover**:\n{{key_points}}\n\n**Tone**: {{tone}}\n\nGuidelines:\n- Keep it concise but thorough\n- Use appropriate greeting and sign-off\n- Include a clear call-to-action\n- Proofread for grammar and professionalism','\n',char(10)),NULL,'business','email,communication,professional',NULL,NULL,NULL,'instruction','beginner',NULL,NULL,0,'Ralphy Team',NULL,NULL,'CC-BY-4.0',898,456,0,203,0,0,0,0,NULL,'1.0.0','published',1,0,0,NULL,'en','2026-01-21 15:59:35',NULL,NULL);
INSERT INTO "prompts" VALUES('prompt_005','creative-story-starter','Creative Story Starter','Generate unique story ideas and opening paragraphs for fiction writing.',replace('Create a compelling story opening based on:\n\n**Genre**: {{genre}}\n**Setting**: {{setting}}\n**Main Character**: {{character}}\n**Conflict/Theme**: {{conflict}}\n\nProvide:\n1. An attention-grabbing opening line\n2. A 200-word opening scene that hooks the reader\n3. Three possible directions the story could take\n4. Key themes to explore\n\nMake it vivid, engaging, and original.','\n',char(10)),NULL,'creative','fiction,storytelling,creative-writing',NULL,NULL,NULL,'instruction','intermediate',NULL,NULL,0,'Ralphy Team',NULL,NULL,'CC-BY-4.0',235,98,0,67,0,0,0,0,NULL,'1.0.0','published',0,0,0,NULL,'en','2026-01-21 15:59:35',NULL,NULL);
INSERT INTO "prompts" VALUES('prompt_006','explain-like-teacher','Explain Like a Teacher','Break down complex topics into simple, understandable explanations for learners.',replace('Explain {{topic}} as if you were teaching it to {{audience}}.\n\nGuidelines:\n- Start with the basics, building up complexity gradually\n- Use analogies and real-world examples\n- Break down jargon into simple terms\n- Include a summary at the end\n- Suggest 3 follow-up topics to explore\n\nMake it engaging and memorable!','\n',char(10)),NULL,'education','teaching,learning,explanation',NULL,NULL,NULL,'instruction','beginner',NULL,NULL,0,'Ralphy Team',NULL,NULL,'CC-BY-4.0',679,289,0,145,0,0,0,0,NULL,'1.0.0','published',1,0,0,NULL,'en','2026-01-21 15:59:35',NULL,NULL);
INSERT INTO "prompts" VALUES('prompt_007','social-media-content','Social Media Content Creator','Generate platform-specific social media content that drives engagement.',replace('Create social media content for {{platform}}:\n\n**Topic/Product**: {{topic}}\n**Goal**: {{goal}}\n**Target Audience**: {{audience}}\n\nProvide:\n1. **Post Copy**: Engaging text optimized for the platform\n2. **Hashtags**: 5-10 relevant hashtags\n3. **Call-to-Action**: Compelling CTA\n4. **Image Suggestion**: Description for an accompanying visual\n5. **Best Time to Post**: Recommendation based on platform norms\n\nMake it scroll-stopping and shareable!','\n',char(10)),NULL,'marketing','social-media,content,engagement',NULL,NULL,NULL,'instruction','beginner',NULL,NULL,0,'Ralphy Team',NULL,NULL,'CC-BY-4.0',446,234,0,112,0,0,0,0,NULL,'1.0.0','published',0,0,0,NULL,'en','2026-01-21 15:59:35',NULL,NULL);
INSERT INTO "prompts" VALUES('prompt_008','debugging-assistant','Debugging Assistant','Systematically debug code issues with structured problem-solving approach.',replace('Help me debug this issue:\n\n**Error Message**:\n{{error}}\n\n**Code Context**:\n{{code}}\n\n**What I Expected**: {{expected}}\n**What Actually Happened**: {{actual}}\n\nPlease:\n1. Identify the likely cause of the issue\n2. Explain why this error occurs\n3. Provide a step-by-step fix\n4. Suggest preventive measures for the future\n5. Share any related best practices','\n',char(10)),NULL,'coding','debugging,troubleshooting,error-fixing',NULL,NULL,NULL,'instruction','intermediate',NULL,NULL,0,'Ralphy Team',NULL,NULL,'CC-BY-4.0',567,298,0,134,0,0,0,0,NULL,'1.0.0','published',1,0,0,NULL,'en','2026-01-21 15:59:35',NULL,NULL);
INSERT INTO "prompts" VALUES('prompt_009','meeting-summarizer','Meeting Notes Summarizer','Transform raw meeting notes into structured, actionable summaries.',replace('Summarize the following meeting notes:\n\n{{notes}}\n\nCreate a structured summary including:\n1. **Meeting Overview**: Date, attendees, purpose\n2. **Key Discussion Points**: Main topics covered\n3. **Decisions Made**: Any decisions reached\n4. **Action Items**: Tasks assigned with owners and deadlines\n5. **Next Steps**: Follow-up meetings or milestones\n6. **Open Questions**: Unresolved items\n\nKeep it concise and actionable.','\n',char(10)),NULL,'business','meetings,productivity,notes',NULL,NULL,NULL,'instruction','beginner',NULL,NULL,0,'Ralphy Team',NULL,NULL,'CC-BY-4.0',335,167,0,78,0,0,0,0,NULL,'1.0.0','published',0,0,0,NULL,'en','2026-01-21 15:59:35',NULL,NULL);
INSERT INTO "prompts" VALUES('prompt_010','api-documentation-writer','API Documentation Writer','Generate clear, developer-friendly API documentation.',replace('Write documentation for this API endpoint:\n\n**Endpoint**: {{endpoint}}\n**Method**: {{method}}\n**Purpose**: {{purpose}}\n\nInclude:\n1. **Description**: Clear explanation of what the endpoint does\n2. **Parameters**: Request parameters with types and descriptions\n3. **Headers**: Required headers\n4. **Request Example**: Sample request with curl\n5. **Response**: Success and error response formats\n6. **Code Examples**: Examples in JavaScript and Python\n7. **Notes**: Any important caveats or tips\n\nFollow REST API documentation best practices.','\n',char(10)),NULL,'coding','api,documentation,developer',NULL,NULL,NULL,'instruction','advanced',NULL,NULL,0,'Ralphy Team',NULL,NULL,'CC-BY-4.0',224,112,0,56,0,0,0,0,NULL,'1.0.0','published',0,0,0,NULL,'en','2026-01-21 15:59:35',NULL,NULL);
